import React, { useState } from 'react';
import { GoogleLogin } from 'react-google-login';
import { useHistory } from 'react-router-dom';
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button"


const Login = () => {
    
        const [email, setEmail] = useState("");
        const [password, setPassword] = useState("");
      
        function validateForm() {
          return email.length > 0 && password.length > 0;
        }
      
        function handleSubmit(event) {
          event.preventDefault();
        }

    const history = useHistory();
    const googleSuccess = async (response) => {
        console.log(response);
        history.push('/')
        alert('Login feito com sucesso')
    }
    const googleFailure = (error) => {
        console.log(error)
        console.log("Google error");
        
    }
    return (
        
        
        <section className="login">
         <div className="Login">
      <Form onSubmit={handleSubmit}>
        <Form.Group size="flex" controlId="email">
          <Form.Label>Email</Form.Label>
          <Form.Control
            autoFocus
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </Form.Group>
        <Form.Group size="flex" controlId="password">
          <Form.Label>Password</Form.Label>
          <Form.Control
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
        </Form.Group>
        <Button block size="flex" type="submit" disabled={!validateForm()}>
          Login
        </Button>
        <div className="text-center ">
        <GoogleLogin 
            clientId="83656149699-rdikfecitstoasn830p37kehfv6evojs.apps.googleusercontent.com"    
            buttonText="Login with Google" 
            onSuccess={googleSuccess}
            onFailure={googleFailure}
            cookiePolicy="single_host_origin"
            isSignedIn={true}
        />
        </div>
      </Form>
        </div>
                    
                        
                  
            
        </section>
        
    )
}

export default Login
